class ActionProvider {
  constructor(
    createChatbotMessage,
    setStateFunc,
    createClientMessage
  ) {
    this.createChatbotMessage =
      createChatbotMessage;
    this.setState = setStateFunc;
    this.createClientMessage =
      createClientMessage;
  }
  greet() {
    this.createChatbotMessage("Hello there!");
  }
}
export default ActionProvider;
